import React, { useState } from 'react';

function Login() {

    const [mail, setMail] = useState("");
    const [password, setPassword] = useState("");

    return (
        <div>
            <input onChange={(e)=>setMail(e)} placeholder="Entrer le mail" value={e.target.value}></input>
            <input onChange={(event)=>setPassword(event)} placeholder="Entrer le mail" value={password}></input>

            {
                mail == "test" && password == "1234" &&
                <p>ok</p>
            }
        </div>
    );
}

export default Login;
